export function getBase64LogoReportes(codigo)
{
    var oBase64 = ""

    if(codigo == 'GADAMBATOH'){
        oBase64 = "data:image/jpeg;base64,"
    }else if(codigo == 'GADAMBATOF')
    {
        oBase64 = "data:image/jpeg;base64,"
    }else if(codigo == 'tjerpazol'){
        oBase64 = "data:image/png;base64,"
    } else{
        oBase64 = "data:image/jpeg;base64,"
    }

    return oBase64

    
}